import React from 'react';
import Collapsewrapper from './Collapsewrapper';
import Button from './Button';

function Navcontent(){
    return(
        <React.Fragment>
        <a class="navbar-brand" href="#">Navbar</a>
        <Button/>
        <Collapsewrapper/>
        </React.Fragment>
    )
}
export default Navcontent;
